import { BrowserRouter, Route, Routes } from 'react-router-dom';
import './App.css';
import Navbar_Footer from './Pages/Navbar_Footer';
import Index from './Pages/Index';


function App() {
  return (
    <div className="App">
      <BrowserRouter>
          <Routes>
            <Route  element={<Navbar_Footer />}>
              <Route path="/" element={<Index />} />
            </Route>
          </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
